Overrides the gradient computation of a function `f`.

Takes a function
`f(...inputs) => {value: Tensor, gradFunc: dy => Tensor[]}` and returns
another function `g(...inputs)` which takes the same inputs as `f`. When
called, `g` returns `f().value`. In backward mode, custom gradients with
respect to each input of `f` are computed using `f().gradFunc`.

```js
const customOp = tf.customGrad(x => {
   // Override gradient of our custom x ^ 2 op to be dy * abs(x);
   return {value: x.square(), gradFunc: dy => [dy.mul(x.abs())]};
});

const x = tf.tensor1d([-1, -2, 3]);
const dx = tf.grad(x => customOp(x));

console.log(`f(x):`);
customOp(x).print();
console.log(`f'(x):`);
dx(x).print();
```

Constructs a `SGDOptimizer` that uses stochastic gradient descent.

```js
// Fit a quadratic function by learning the coefficients a, b, c.
const xs = tf.tensor1d([0, 1, 2, 3]);
const ys = tf.tensor1d([1.1, 5.9, 16.8, 33.9]);

const a = tf.scalar(Math.random()).variable();
const b = tf.scalar(Math.random()).variable();
const c = tf.scalar(Math.random()).variable();

// y = a * x^2 + b * x + c.
const f = x => a.mul(x.square()).add(b.mul(x)).add(c);
const loss = (pred, label) => pred.sub(label).square().mean();

const learningRate = 0.01;
const optimizer = tf.train.sgd(learningRate);

// Train the model.
for (let i = 0; i < 10; i++) {
   optimizer.minimize(() => loss(f(xs), ys));
}

// Make predictions.
console.log(
     `a: ${a.dataSync()}, b: ${b.dataSync()}, c: ${c.dataSync()}`);
const preds = f(xs).dataSync();
preds.forEach((pred, i) => {
   console.log(`x: ${i}, pred: ${pred}`);
});
```

Executes the provided function `fn` and after it is executed, cleans up all
intermediate tensors allocated by `fn` except those returned by `fn`.
`f` must not return a Promise (async functions not allowed).
The returned result can be a complex object, however tidy only walks the
top-level properties (depth 1) of that object to search for tensors, or
lists of tensors that need to be tracked in the parent scope.

Using this method helps avoid memory leaks. In general, wrap calls to
operations in `tidy` for automatic memory cleanup.

When in safe mode, you must enclose all `Tensor` creation and ops
inside a `tidy` to prevent memory leaks.

```js
// y = 2 ^ 2 + 1
const y = tf.tidy(() => {
   // a, b, and one will be cleaned up when the tidy ends.
   const one = tf.scalar(1);
   const a = tf.scalar(2);
   const b = a.square();

   console.log('numTensors (in tidy): ' + tf.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
y.print();
```

Keeps a `Tensor` generated inside a `tidy` from being disposed
automatically.

```js
let b;
const y = tf.tidy(() => {
   const one = tf.scalar(1);
   const a = tf.scalar(2);

   // b will not be cleaned up by the tidy. a and one will be cleaned up
   // when the tidy ends.
   b = tf.keep(a.square());

   console.log('numTensors (in tidy): ' + tf.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
console.log('y:');
y.print();
console.log('b:');
b.print();
```

